      const Logout=state=>{
        //  console.log(state)
            logoutUser(token)
            emailState("")
            passwordState("")
            errorState("")
            tokenState("")
      
          
        }
      


    return (
        <div>

  <div className="wrapper">
    <div className="wave"></div>
  </div>
  <div className="container">

    <Background name="{email}" />

    <div className="login-container">
      <div>

        <h1>Hello {email}</h1>
        <button className="btn" onClick="{Logout}">logout</button>
      </div>
    </div>
  </div>

</div>
  );
    }


